import hats from '../../assets/directory/hats.svg';
import jackets from '../../assets/directory/jackets.svg';
import sneakers from '../../assets/directory/sneakers.svg';
import mens from '../../assets/directory/men.svg';
import womens from '../../assets/directory/women.svg';

const INITIAL_STATE = {
  sections: [
    {
      title: 'hats',
      imageUrl: hats,
      id: 1,
      linkUrl: 'shop/hats'
    },
    {
      title: 'jackets',
      imageUrl: jackets,
      id: 2,
      linkUrl: 'shop/jackets'
    },
    {
      title: 'sneakers',
      imageUrl: sneakers,
      id: 3,
      linkUrl: 'shop/sneakers'
    },
    {
      title: 'mens',
      imageUrl: mens,
      size: 'large',
      id: 5,
      linkUrl: 'shop/mens'
    },
    {
      title: 'womens',
      imageUrl: womens,
      size: 'large',
      id: 4,
      linkUrl: 'shop/womens'
    }
  ]
};

const directoryReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default directoryReducer;
